import React, { useState } from "react";
import "./Password.css";

function Password() {
    const [input, setInput] = useState("") // 입력값 상태 관리

    // 키 입력 핸들러
    const handleKeyClick = (key) => {
        if (input.length < 5) {
            const newInput = input + key;
        }
    }

    return (
        <div className="keyboard-container">
            {/* Display */}
            <div class="display">
                <div class="black-key">0</div>
                <div class="black-key">1</div>
                <div class="black-key">2</div>
                <div class="black-key">3</div>
                <div class="black-key">4</div>
            </div>

            {/* Keypad */}
            <div class="key">1</div>
            <div class="key">2</div>
            <div class="key">3</div>
            <div class="action-key">↻</div>

            <div class="key">4</div>
            <div class="key">5</div>
            <div class="key">6</div>
            <div class="action-key">⌫</div>

            <div class="key">7</div>
            <div class="key">8</div>
            <div class="key">9</div>
            <div></div>

            <div></div>
            <div class="key">0</div>
            <div></div>
            <div></div>
        </div>
    );
}

export default Password;
